@Override
public NumericType getNumericType() {
  switch (type) {
    case INTEGER:
      return NumericType.INT;
    case LONG:
    case DATE:
      return NumericType.LONG;
    case FLOAT:
      return NumericType.FLOAT;
    case DOUBLE:
      return NumericType.DOUBLE;
    default:
      throw new AssertionError();
  }
}

